import React from 'react';
import { WorldMap } from 'grommet';

export const Map = () => {
    return (
        <WorldMap
        fill='horizontal'
        color="neutral-1"
        continents={[
          {
            name: 'Africa',
            color: 'black',
            onClick: (name) => {},
          },
          {
            name: 'Europe',
            color: 'blue',
            onClick: (name) => {},
          },
          {
            name: 'Oceanie',
            color: 'green',
            onClick: (name) => {},
          },
        ]}
        onSelectPlace={(lat, lon) => {}}
        places={[
          {
            name: 'Sydney',
            location: [-33.8830555556, 151.216666667],
            color: 'accent-2',
            onClick: (name) => {},
          },
        ]}
        selectColor="accent-2"
      />
    )
}


export default Map
